import React from 'react';
import GoogleWritingImage from '../images/google-writing-svg.svg';

const StaticElementsContainer = ({ children }) => {
  return (
    <div>
      <GoogleWritingImage />
      {children}
      <footer>This is the footer</footer>
    </div>
  );
};

export default StaticElementsContainer;
